import { GET_ALL_EVENTS, GET_THREE_FIRST_EVENTS } from "../constants/reducers";
const initialState = {};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_ALL_EVENTS:
    case GET_THREE_FIRST_EVENTS:
      return action.payload;

    default:
      return state;
  }
}
